import React from 'react';
import LoginPage from './LoginPage.png';
import ProductPage from './ProdutPage.png';
import '../styles/Style.css';


const Project = () => {
    return (
        <div>
            <img height={150} width={100} className='project-image' src={LoginPage} />
            <img height={150} width={100} className='project-image' src={ProductPage} />
        </div>
    )
}

export default Project
